import React from 'react';
import PropTypes from 'prop-types';
import {
  Typographys,
  styles,
  Card,
  Image,
  ImageContent,
  CardBody,
  CardFooter,
} from './GenerationCardStyle';
import Grid from '@material-ui/core/Grid';
import { Container } from '../Utils/styleUtils';
import { colors } from '../../styles/styles';

const GenerationCard = ({
    generations,
}) => (
  <Container container justify="center" alignItems="baseline">
    {
      generations.map((item) => (
        item.map((generation) => (
          <Grid align="center" item xs={12} sm={3} key={generation}>
            <Card style={styles.cardPokemon} elevation={2}>
                <Typographys variant="title">{generation}</Typographys>
            </Card>
          </Grid>
        ))
      ))
    }
  </Container>
);

GenerationCard.propTypes = {
  generations: PropTypes.array,
}

export default GenerationCard;
